INSERT INTO `egg_variables` VALUES (1,1,'Server Jar File','The name of the server jarfile to run the server with.','SERVER_JARFILE','server.jar',1,1,'required|regex:/^([\\w\\d._-]+)(\\.jar)$/','2023-06-26 10:14:27','2023-06-26 19:25:53'),(2,1,'Server Version','The version of Minecraft Vanilla to install. Use \"latest\" to install the latest version, or use \"snapshot\" to install the latest snapshot. Go to Settings > Reinstall Server to apply.','VANILLA_VERSION','latest',1,1,'required|string|between:3,15','2023-06-26 10:14:27','2023-06-26 19:25:53'),(3,2,'Server Jar File','The name of the Jarfile to use when running Forge version below 1.17.','SERVER_JARFILE','server.jar',1,1,'required|regex:/^([\\w\\d._-]+)(\\.jar)$/','2023-06-26 10:14:27','2023-06-26 19:25:53'),(4,2,'Minecraft Version','The version of minecraft you want to install for.\r\n\r\nLeaving latest will install the latest recommended version.','MC_VERSION','latest',1,1,'required|string|max:9','2023-06-26 10:14:27','2023-06-26 19:25:53'),(5,2,'Build Type','The type of server jar to download from forge.\r\n\r\nValid types are \"recommended\" and \"latest\".','BUILD_TYPE','recommended',1,1,'required|string|in:recommended,latest','2023-06-26 10:14:27','2023-06-26 19:25:53'),(6,2,'Forge Version','The full exact version.\r\n\r\nEx. 1.15.2-31.2.4\r\n\r\nOverrides MC_VERSION and BUILD_TYPE. If it fails to download the server files it will fail to install.','FORGE_VERSION','',1,1,'nullable|regex:/^[0-9\\.\\-]+$/','2023-06-26 10:14:27','2023-06-26 19:25:53'),(7,3,'Bungeecord Version','The version of Bungeecord to download and use.','BUNGEE_VERSION','latest',1,1,'required|alpha_num|between:1,6','2023-06-26 10:14:27','2023-06-26 19:25:53'),(8,3,'Bungeecord Jar File','The name of the Jarfile to use when running Bungeecord.','SERVER_JARFILE','bungeecord.jar',1,1,'required|regex:/^([\\w\\d._-]+)(\\.jar)$/','2023-06-26 10:14:27','2023-06-26 19:25:53'),(9,4,'Minecraft Version','The version of minecraft to download. \r\n\r\nLeave at latest to always get the latest version. Invalid versions will default to latest.','MINECRAFT_VERSION','latest',1,1,'nullable|string|max:20','2023-06-26 10:14:27','2023-06-26 19:25:53'),(10,4,'Server Jar File','The name of the server jarfile to run the server with.','SERVER_JARFILE','server.jar',1,1,'required|regex:/^([\\w\\d._-]+)(\\.jar)$/','2023-06-26 10:14:27','2023-06-26 19:25:53'),(11,4,'Download Path','A URL to use to download a server.jar rather than the ones in the install script. This is not user viewable.','DL_PATH','',0,0,'nullable|string','2023-06-26 10:14:27','2023-06-26 19:25:53'),(12,4,'Build Number','The build number for the paper release.\r\n\r\nLeave at latest to always get the latest version. Invalid versions will default to latest.','BUILD_NUMBER','latest',1,1,'required|string|max:20','2023-06-26 10:14:27','2023-06-26 19:25:53'),(13,5,'Sponge Version','The version of SpongeVanilla to download and use.','SPONGE_VERSION','1.12.2-7.3.0',1,1,'required|regex:/^([a-zA-Z0-9.\\-_]+)$/','2023-06-26 10:14:27','2023-06-26 19:25:53'),(14,5,'Server Jar File','The name of the Jarfile to use when running SpongeVanilla.','SERVER_JARFILE','server.jar',1,1,'required|regex:/^([\\w\\d._-]+)(\\.jar)$/','2023-06-26 10:14:27','2023-06-26 19:25:53'),(15,6,'Game ID','The ID corresponding to the game to download and run using SRCDS.','SRCDS_APPID','',1,0,'required|numeric|digits_between:1,6','2023-06-26 10:14:27','2023-06-26 19:25:53'),(16,6,'Game Name','The name corresponding to the game to download and run using SRCDS.','SRCDS_GAME','',1,0,'required|alpha_dash|between:1,100','2023-06-26 10:14:27','2023-06-26 19:25:53'),(17,6,'Map','The default map for the server.','SRCDS_MAP','',1,1,'required|string|alpha_dash','2023-06-26 10:14:27','2023-06-26 19:25:53'),(18,6,'Steam Username','','STEAM_USER','',1,1,'nullable|string','2023-06-26 10:14:27','2023-06-26 19:25:53'),(19,6,'Steam Password','','STEAM_PASS','',1,1,'nullable|string','2023-06-26 10:14:27','2023-06-26 19:25:53'),(20,6,'Steam Auth','','STEAM_AUTH','',1,1,'nullable|string','2023-06-26 10:14:27','2023-06-26 19:25:53'),(21,7,'Game ID','The ID corresponding to the game to download and run using SRCDS.','SRCDS_APPID','232250',1,0,'required|regex:/^(232250)$/','2023-06-26 10:14:27','2023-06-26 19:25:53'),(22,7,'Default Map','The default map to use when starting the server.','SRCDS_MAP','cp_dustbowl',1,1,'required|regex:/^(\\w{1,20})$/','2023-06-26 10:14:27','2023-06-26 19:25:53'),(23,7,'Steam','The Steam Game Server Login Token to display servers publicly. Generate one at https://steamcommunity.com/dev/managegameservers','STEAM_ACC','',1,1,'required|string|alpha_num|size:32','2023-06-26 10:14:27','2023-06-26 19:25:53'),(24,8,'Server Password','If specified, players must provide this password to join the server.','ARK_PASSWORD','',1,1,'nullable|alpha_dash|between:1,100','2023-06-26 10:14:27','2023-06-26 19:25:53'),(25,8,'Admin Password','If specified, players must provide this password (via the in-game console) to gain access to administrator commands on the server.','ARK_ADMIN_PASSWORD','PleaseChangeMe',1,1,'required|alpha_dash|between:1,100','2023-06-26 10:14:27','2023-06-26 19:25:53'),(26,8,'Server Map','Available Maps: TheIsland, TheCenter, Ragnarok, ScorchedEarth_P, Aberration_P, Extinction, Valguero_P, Genesis, CrystalIsles, Gen2, LostIsland, Fjordur','SERVER_MAP','TheIsland',1,1,'required|string|max:20','2023-06-26 10:14:27','2023-06-26 19:25:53'),(27,8,'Server Name','ARK server name','SESSION_NAME','A Pterodactyl Hosted ARK Server',1,1,'required|string|max:128','2023-06-26 10:14:28','2023-06-26 19:25:53'),(28,8,'Rcon Port','ARK rcon port used by rcon tools.','RCON_PORT','27020',1,1,'required|numeric','2023-06-26 10:14:28','2023-06-26 19:25:53'),(29,8,'Query Port','ARK query port used by steam server browser and ark client server browser.','QUERY_PORT','27015',1,1,'required|numeric','2023-06-26 10:14:28','2023-06-26 19:25:53'),(30,8,'Auto-update server','This is to enable auto-updating for servers.\r\n\r\nDefault is 0. Set to 1 to update','AUTO_UPDATE','0',1,1,'required|boolean','2023-06-26 10:14:28','2023-06-26 19:25:53'),(31,8,'Battle Eye','Enable BattleEye\r\n\r\n0 to disable\r\n1 to enable\r\n\r\ndefault=\"1\"','BATTLE_EYE','1',1,1,'required|boolean','2023-06-26 10:14:28','2023-06-26 19:25:53'),(32,8,'App ID','ARK steam app id for auto updates. Leave blank to avoid auto update.','SRCDS_APPID','376030',1,0,'nullable|numeric','2023-06-26 10:14:28','2023-06-26 19:25:53'),(33,8,'Additional Arguments','Specify additional launch parameters such as -crossplay. You must include a dash - and separate each parameter with space: -crossplay -exclusivejoin','ARGS','',1,1,'nullable|string','2023-06-26 10:14:28','2023-06-26 19:25:53'),(34,9,'Game ID','The ID corresponding to the game to download and run using SRCDS.','SRCDS_APPID','237410',1,0,'required|regex:/^(237410)$/','2023-06-26 10:14:28','2023-06-26 19:25:53'),(35,9,'Default Map','The default map to use when starting the server.','SRCDS_MAP','sinjar',1,1,'required|regex:/^(\\w{1,20})$/','2023-06-26 10:14:28','2023-06-26 19:25:53'),(36,10,'Map','The default map for the server.','SRCDS_MAP','gm_flatgrass',1,1,'required|string|alpha_dash','2023-06-26 10:14:28','2023-06-26 19:25:53'),(37,10,'Steam Account Token','The Steam Account Token required for the server to be displayed publicly.','STEAM_ACC','',1,1,'nullable|string|alpha_num|size:32','2023-06-26 10:14:28','2023-06-26 19:25:53'),(38,10,'Source AppID','Required for game to update on server restart. Do not modify this.','SRCDS_APPID','4020',0,0,'required|string|max:20','2023-06-26 10:14:28','2023-06-26 19:25:53'),(39,10,'Workshop ID','The ID of your workshop collection (the numbers at the end of the URL)','WORKSHOP_ID','',1,1,'nullable|integer','2023-06-26 10:14:28','2023-06-26 19:25:53'),(40,10,'Gamemode','The gamemode of your server.','GAMEMODE','sandbox',1,1,'required|string','2023-06-26 10:14:28','2023-06-26 19:25:53'),(41,10,'Max Players','The maximum amount of players allowed on your game server.','MAX_PLAYERS','32',1,1,'required|integer|max:128','2023-06-26 10:14:28','2023-06-26 19:25:53'),(42,10,'Tickrate','The tickrate defines how fast the server will update each entity\'s location.','TICKRATE','22',1,1,'required|integer|max:100','2023-06-26 10:14:28','2023-06-26 19:25:53'),(43,10,'Lua Refresh','0 = disable Lua refresh,\r\n1 = enable Lua refresh','LUA_REFRESH','0',1,1,'required|boolean','2023-06-26 10:14:28','2023-06-26 19:25:53'),(44,11,'Map','The default map for the server.','SRCDS_MAP','de_dust2',1,1,'required|string|alpha_dash','2023-06-26 10:14:28','2023-06-26 19:25:53'),(45,11,'Steam Account Token','The Steam Account Token required for the server to be displayed publicly.','STEAM_ACC','',1,1,'required|string|alpha_num|size:32','2023-06-26 10:14:28','2023-06-26 19:25:53'),(46,11,'Source AppID','Required for game to update on server restart. Do not modify this.','SRCDS_APPID','740',0,0,'required|string|max:20','2023-06-26 10:14:28','2023-06-26 19:25:53'),(47,12,'Server Version','The version of Teamspeak 3 to use when running the server.','TS_VERSION','latest',1,1,'required|string|max:6','2023-06-26 10:14:28','2023-06-26 19:25:53'),(48,12,'File Transfer Port','The Teamspeak file transfer port','FILE_TRANSFER','30033',1,0,'required|integer|between:1025,65535','2023-06-26 10:14:28','2023-06-26 19:25:53'),(49,12,'Query Port','The Teamspeak Query Port','QUERY_PORT','10011',1,0,'required|integer|between:1025,65535','2023-06-26 10:14:28','2023-06-26 19:25:53'),(50,12,'Query Protocols','Comma separated list of protocols that can be used to connect to the ServerQuery | \r\nPossible values are raw, ssh and http | \r\nE.g.: raw,ssh,http','QUERY_PROTOCOLS_VAR','raw,http,ssh',1,1,'required|string|max:12','2023-06-26 10:14:28','2023-06-26 19:25:53'),(51,12,'Query SSH Port','TCP Port opened for ServerQuery connections using SSH','QUERY_SSH','10022',1,0,'required|integer|between:1025,65535','2023-06-26 10:14:28','2023-06-26 19:25:53'),(52,12,'Query HTTP Port','TCP Port opened for ServerQuery connections using http','QUERY_HTTP','10080',1,0,'required|integer|between:1025,65535','2023-06-26 10:14:28','2023-06-26 19:25:53'),(53,13,'Maximum Users','Maximum concurrent users on the mumble server.','MAX_USERS','100',1,0,'required|numeric|digits_between:1,5','2023-06-26 10:14:28','2023-06-26 19:25:53'),(54,14,'Server Name','The name of your server in the public server list.','HOSTNAME','A Rust Server',1,1,'required|string|max:60','2023-06-26 10:14:28','2023-06-26 19:25:53'),(55,14,'OxideMod','Set whether you want the server to use and auto update OxideMod or not. Valid options are \"1\" for true and \"0\" for false.','OXIDE','0',1,1,'required|boolean','2023-06-26 10:14:28','2023-06-26 19:25:53'),(56,14,'Level','The world file for Rust to use.','LEVEL','Procedural Map',1,1,'required|string|max:20','2023-06-26 10:14:28','2023-06-26 19:25:53'),(57,14,'Description','The description under your server title. Commonly used for rules & info. Use \\n for newlines.','DESCRIPTION','Powered by Pterodactyl',1,1,'required|string','2023-06-26 10:14:28','2023-06-26 19:25:53'),(58,14,'URL','The URL for your server. This is what comes up when clicking the \"Visit Website\" button.','SERVER_URL','http://pterodactyl.io',1,1,'nullable|url','2023-06-26 10:14:28','2023-06-26 19:25:53'),(59,14,'World Size','The world size for a procedural map.','WORLD_SIZE','3000',1,1,'required|integer','2023-06-26 10:14:28','2023-06-26 19:25:53'),(60,14,'World Seed','The seed for a procedural map.','WORLD_SEED','',1,1,'nullable|string','2023-06-26 10:14:28','2023-06-26 19:25:53'),(61,14,'Max Players','The maximum amount of players allowed in the server at once.','MAX_PLAYERS','40',1,1,'required|integer','2023-06-26 10:14:28','2023-06-26 19:25:53'),(62,14,'Server Image','The header image for the top of your server listing.','SERVER_IMG','',1,1,'nullable|url','2023-06-26 10:14:28','2023-06-26 19:25:53'),(63,14,'RCON Port','Port for RCON connections.','RCON_PORT','28016',1,0,'required|integer','2023-06-26 10:14:28','2023-06-26 19:25:53'),(64,14,'RCON Password','RCON access password.','RCON_PASS','CHANGEME',1,1,'required|regex:/^[\\w.-]*$/|max:64','2023-06-26 10:14:28','2023-06-26 19:25:53'),(65,14,'Save Interval','Sets the servers auto-save interval in seconds.','SAVEINTERVAL','60',1,1,'required|integer','2023-06-26 10:14:28','2023-06-26 19:25:53'),(66,14,'Additional Arguments','Add additional startup parameters to the server.','ADDITIONAL_ARGS','',1,1,'nullable|string','2023-06-26 10:14:28','2023-06-26 19:25:53'),(67,14,'App Port','Port for the Rust+ App. -1 to disable.','APP_PORT','28082',1,0,'required|integer','2023-06-26 10:14:29','2023-06-26 19:25:53'),(68,14,'Server Logo','The circular server logo for the Rust+ app.','SERVER_LOGO','',1,1,'nullable|url','2023-06-26 10:14:29','2023-06-26 19:25:53'),(69,14,'Custom Map URL','Overwrites the map with the one from the direct download URL. Invalid URLs will cause the server to crash.','MAP_URL','',1,1,'nullable|url','2023-06-26 10:14:29','2023-06-26 19:25:53');
